import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Dashboard() {
  const [bookingCount, setBookingCount] = useState(0);
  const [parkingCount, setParkingCount] = useState(0);
  const [vehicleCount, setVehicleCount] = useState(0);
  const [ownerCount, setOwnerCount] = useState(0);

  useEffect(() => {
    // Retrieve data from backend API
    axios.get('/api/dashboard')
      .then(response => {
        setBookingCount(response.data.bookingCount);
        setParkingCount(response.data.parkingCount);
        setVehicleCount(response.data.vehicleCount);
        setOwnerCount(response.data.ownerCount);
      })
      .catch(error => {
        console.log(error);
      });
    }, []);

  return (
    <div className="dashboard">
      <h1>Dashboard</h1>
      <p>Total Number of Bookings: {bookingCount}</p>
      <p>Number of Parking Slots: {parkingCount}</p>
      <p>Total Number of Vehicles: {vehicleCount}</p>
      <p>Total Number of Vehicle Owners: {ownerCount}</p>
    </div>
  );
}

export default Dashboard;
